    return (
        <div className="template-search__header page-width center">
          <h1 className="h2">Search</h1>
          <div className="template-search__search">
            <form action="/search" method="get" role="search" className="search">
              <div className="field">
                <input
                  className="search__input field__input"
                  id="Search-In-Template"
                  type="search"
                  name="q"
                  value=""
                  placeholder="Search"
                />
                <label className="field__label" htmlFor="Search-In-Template">
                  Search
                </label>
                <input name="options[prefix]" type="hidden" value="last" />
                <button type="submit" className="search__button field__button" aria-label="Search">
                  {/* SVG Icon */}
                  <svg
                    version="1.1"
                    id="Layer_1"
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                    x="0px"
                    y="0px"
                    viewBox="0 0 500 500"
                    xmlSpace="preserve"
                    fill="currentColor"
                    className="icon icon-search"
                  >
                    <g id="Icon_search" transform="translate(1.101 1.101)">
                      <g id="Path_2751">
                        <path
                          d="M474.4,494c-4.8,0-9.5-1.8-13.1-5.1L340.1,367.8c-78.9,65.4-193,63.1-269.4-6.7c-83.7-76.4-89.6-206.6-13.2-290.3C94.6,30.2,145.1,6.6,200,4.1c54.8-2.6,107.4,16.5,147.9,53.5c40.5,37,64.2,87.6,66.7,142.4c2.3,51.4-14.3,100.8-46.8,140.2l121.2,121.2c6.7,7.4,6.7,18.7,0,26.1c-3.5,3.9-8.3,6.1-13.5,6.4C475,494,474.7,494,474.4,494z M473,475.7L473,475.7L473,475.7z M209.8,44c-91.5,0-165.9,74.4-165.9,165.9c0,91.5,74.4,165.9,165.9,165.9c91.4-0.1,165.8-74.6,165.9-165.9C375.8,118.4,301.3,44,209.8,44z"
                        ></path>
                      </g>
                    </g>
                  </svg>
                  {/* End of SVG Icon */}
                </button>
              </div>
            </form>
          </div>
        </div>
      );


    // return (
